import{_ as s,o as a,c as o,O as t}from"./chunks/framework.9be35eee.js";const D=JSON.parse('{"title":"Database Dump","description":"","frontmatter":{},"headers":[],"relativePath":"db-dump.md","filePath":"db-dump.md"}'),e={name:"db-dump.md"},n=t('<h1 id="database-dump" tabindex="-1">Database Dump <a class="header-anchor" href="#database-dump" aria-label="Permalink to &quot;Database Dump&quot;">​</a></h1><p>Coconut online provides users with multiple download options, and one of them is the Postgres dump. At the end of each month, precisely at 00:00 CET, a snapshot of the Coconut database is taken and archived in an S3 storage bucket. To obtain the dump file of the most recent snapshot, navigate to the left panel and locate the &quot;Download&quot; button. Click on the <code>Download</code> with option labeled &quot;Download the COCONUT dataset as a Postgres dump.&quot; This will initiate the download of the dump file containing the latest snapshot.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The Postgres dump exclusively comprises data from the following tables: molecules, properties, and citations.</p></div><h2 id="instruction-to-restore" tabindex="-1">Instruction to restore <a class="header-anchor" href="#instruction-to-restore" aria-label="Permalink to &quot;Instruction to restore&quot;">​</a></h2><p>To restore the database using the dump file, follow these instructions:</p><ul><li><p>Make sure that Postgres (version 14.0 or higher) is up and running on your system.</p></li><li><p>Unzip the downloaded dump file.</p></li><li><p>To import, run the below command by replacing the database name and username with yours and enter the password when prompted.</p></li></ul><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">psql</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-h</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">127.0</span><span style="color:#C3E88D;">.0.1</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-p</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">5432</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-d</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">database</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">name</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-U</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">username</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-W</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">postgresql-coconut.sql</span></span></code></pre></div>',7),l=[n];function p(r,c,i,d,u,h){return a(),o("div",null,l)}const m=s(e,[["render",p]]);export{D as __pageData,m as default};
